import logo from "./logo.svg";
import "./assets/css/App.css";
import React from "react";
import { BrowserRouter } from "react-router-dom";

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<p>Home</p>} />
            </Routes>
        </BrowserRouter>
    );
}

export default App;
